import TypeSelector from "./TypeSelector"

function QrType(){
    const types = [{type:'FRANCE'}, {type:'FRONTIÈRE'}]
    return(
        <div className="qrType">
            {
                types.map(curType => {
                    return(
                        <TypeSelector curType={curType}></TypeSelector>
                    )
                })
            }
        </div>
    )
}

export default QrType
